const Hero = () => {
    return ( <section className="grid items-center grid-cols-2">

        {/* Hero Content */}
        <div>
            <h1 className="font-bold text-headline-48 text-primary-500">Accelerate Your Learning At RMIT Now!</h1>
            <p>Explore more than 2000 courses from various industry domains.</p>
        </div>

        
